import { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import { apiTestFindAll } from "../../api/apiList";

const Test = () => {
  const [data, setData] = useState([]);

  const getData = () => {
    apiTestFindAll().then((res) => {
      console.log(res);
      setData(res);
    });
  };

  useEffect(() => {
    getData();
  }, []);

  return (
    <div>
      <ul>
        {data.map((item) => {
          return (
            <li key={item.id}>
              <Link to={`/board/view/${item.id}`}>{item.title}</Link>
            </li>
          );
        })}
      </ul>
    </div>
  );
};

export default Test;
